import React from 'react'
import { Link } from 'react-router-dom'

const CabinetPopUp = () => {
  return (
    <div>
      <div><Link to='/logib'>Login</Link></div>
      <div><Link to='/registration'>Create account</Link></div>
    </div>
    
  )
}

export default CabinetPopUp
